import './App.css';
import Logo from './components/logo';

const textoOpções = ['Projetos', 'Esqueci'];

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <Logo></Logo>
        <ul className='opcoes'>
          {textoOpções}
        </ul>
      </header>
      <h2 className='texto_construcao'>Em construção</h2>
    </div>
  );
}

export default App;
